INSERT INTO `growth_rates` (`id`, `identifier`, `formula`) VALUES
(1, 'slow', 'frac{5x^3}{4}'),
(2, 'medium', 'x^3'),
(3, 'fast', 'frac{4x^3}{5}'),
(4, 'medium-slow', 'frac{6x^3}{5} - 15x^2 + 100x - 140'),
(5, 'slow-then-very-fast', 'egin{cases}\nfrac{ x^3 left( 100 - x \right) }{50},    & 	ext{if } x leq 50  \\\nfrac{ x^3 left( 150 - x \right) }{100},   & 	ext{if } 50 < x leq 68  \\\nfrac{ x^3 left( 1274 + (x mod 3)^2 - 9 (x mod 3) - 20 leftlfloor frac{x}{3} \right\rfloor \right) }{1000}, & 	ext{if } 68 < x leq 98  \\\nfrac{ x^3 left( 160 - x \right) }{100},   & 	ext{if } x > 98  \\\nend{cases}'),
(6, 'fast-then-very-slow', 'egin{cases}\nfrac{ x^3 left( 24 + leftlfloor frac{x+1}{3} \right\rfloor \right) }{50},  & 	ext{if } x leq 15  \\\nfrac{ x^3 left( 14 + x \right) }{50},     & 	ext{if } 15 < x leq 35  \\\nfrac{ x^3 left( 32 + leftlfloor frac{x}{2} \right\rfloor \right ) }{50},   & 	ext{if } x > 35  \\\nend{cases}');
